import React from 'react';
import './index.css';
import { BrowserRouter } from 'react-router-dom';
import { Link } from 'react-router-dom';

class App extends React.Component {
  render(){
    return(
      <BrowserRouter>
        <div className='container'>
          <h1>Recursero Diversidad</h1>
          <br/>
          <Link to='/'>Inicio</Link>
        </div>
      </BrowserRouter>
    )
  }
}

export default App;
